import React, {useState} from 'react';

function Signup() {
    //id, hash_id, first_name, last_name, email, password, dob, mobile_number, phone_number, address, user_type(1 - Admin, 2 - house owner, 3 - tenant), user_status (1 - active, 0 - disabled), created_on, modified_on
    const submitSignup = (evt) => {
        evt.preventDefault();
        console.log(signupForm);
    };
    const handleChange = (e) => {
        console.log(e.target.value, e.target.name);
        signupForm[e.target.name] = e.target.value;
    };
    
    let form = {
        first_name: '',
        last_name: '',
        email: '',
        password:'',
        confirm_password: '',
        dob:'',
        mobile_number:0,
        phone_number:0,
        address: ''
    }
    const [signupForm, setForm] = useState(form);
    return (
        <section>
            <h4 className="text-center">Signup Page</h4>
            <div className="">
                <form onSubmit={submitSignup}>
                    <input type="text" onChange={(e) => handleChange(e)} name="first_name" id="first_name" value={signupForm.first_name} />
                </form>
            </div>
        </section>
    );
}

export default Signup;
